// Header.js
import React from 'react';

const Header = () => {
  return (
    <header>
      {/* Logo */}
      <div className="logo">Elite Sports</div>
      {/* Navigation */}
      <nav>
        <ul>
          <li><a href="#">Home</a></li>
          <li><a href="#">About</a></li>
          {/* Add more navigation links as needed */}
        </ul>
      </nav>
    </header>
  );
}

export default Header;
